import React from 'react';
import Navbar from "../components/Navbar";
import Cart from "../components/Cart";

const CartPage = ({ cart, setCart, juices, setJuices}) => {
    return(
        <div>
            <Navbar />
            <Cart cart={cart} setCart={setCart} juices={juices} setJuices={setJuices} path="/cart" />
        </div>
    )
}

export default CartPage;
